import React, {useEffect, useState} from 'react';
import MakeupInfo from '../../makeupInfo.json.';

//import brandAssessment from '../../components/brandAssessment/index.js';
//import adoptionPrompt from '../../components/adoptionPrompt/index.js';
//import '../../ldHigmVe_orgs_1.json.parse';

class BrandList {
  render(){
    return (
      <div>
        <h1>Which of these makeup brands do you use?</h1>
        <h4>Choose One</h4>
        {MakeupInfo.map((brand, index) => {
          return <div>
            <h1>{brand.brand}</h1>
          </div>
        })}
      </div>
    )
  }
}
export default MakeupInfo;
